import "./MobileTest.css";

function MobileTest() {
  return (
    <div className="MParent">
      <div className="FriendsList" id="FriendsList">
        <div className="AddFriend">
          <input type="text" className="addfrtxt"></input>
          <button className="addfrbtn"></button>
        </div>
      </div>
      <div className="Chat">
        <div className="ChatHeader"></div>
        <div className="Chatcontainer"></div>
        <div className="Chatinp"></div>
      </div>
    </div>
  );
}

export default MobileTest;
